use std::fmt; #[derive(Debug, PartialEq)]
pub struct Clock { hours: i32, minutes: i32,
}
const HOURS_PER_DAY: i32 = 24;
const MINUTES_PER_HOUR: i32 = 60;
const MINUTES_PER_DAY: i32 = MINUTES_PER_HOUR * HOURS_PER_DAY; impl Clock { pub fn new(hours: i32, minutes: i32) -> Self { let total_minutes = total_minutes(hours, minutes); let hours = total_minutes / MINUTES_PER_HOUR; let minutes = total_minutes % MINUTES_PER_HOUR; Self { hours, minutes } } pub fn add_minutes(&self, minutes: i32) -> Self { Self::new(self.hours, self.minutes + minutes) }
} impl fmt::Display for Clock { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { write!(f, "{:02}:{:02}", self.hours, self.minutes) }
} fn total_minutes(hours: i32, minutes: i32) -> i32 { let total_minutes = (hours * MINUTES_PER_HOUR + minutes) % MINUTES_PER_DAY; if total_minutes >= 0 { total_minutes } else { total_minutes + MINUTES_PER_DAY }
} #[test]
fn test_on_the_hour() { assert_eq!(Clock::new(8, 0).to_string(), "08:00");
} #[test]
fn test_midnight_is_zero_hours() { assert_eq!(Clock::new(24, 0).to_string(), "00:00");
} #[test]
fn test_add_across_midnight() { let clock = Clock::new(23, 59).add_minutes(2); assert_eq!(clock.to_string(), "00:01");
} derive 运用宏 impl<T: PartialEq> PartialEq for Clock { fn eq(&self, other: &Clock) -> bool { self.a == other.a && self.b == other.b } fn ne(&self, other: &Clock) -> bool { self.a != other.a || self.b != other.b }
} traits 特性 structs 结构体 cargo test可快速进行运行测试

