6.times { put "6" } // Rust
fn main() { 6.times(|_| println!("6"));
} pub trait Times where Self: Sized { fn times<F: FnMut(Self)>(&self, closure: F);
} macro_rules! impl_times { ($ptype:ty) => { impl Times for $ptype { fn times<F: FnMut($ptype)>(&self, mut closure: F) { for i in 0..*self { closure(i) } } } }
} impl_times!(i8);
impl_times!(u8);
impl_times!(i16);
impl_times!(u16);
impl_times!(i32);
impl_times!(u32);
impl_times!(i64);
impl_times!(u64);
impl_times!(usize); 不存在运行时性能开销，编译时完成。 零成本抽象基石：泛型和 trait
